CREATE DATABASE IF NOT EXISTS sistema;

USE sistema;

DROP TABLE IF EXISTS actividades;

CREATE TABLE `actividades` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_obligacion` varchar(3) COLLATE utf8_spanish2_ci NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `fecha_a_realizar` datetime NOT NULL,
  `fecha_emision` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS adicional_tmp;

CREATE TABLE `adicional_tmp` (
  `id_ad_tmp` int(11) NOT NULL AUTO_INCREMENT,
  `id_usuario` int(11) NOT NULL,
  `serie_factura` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_factura` int(11) NOT NULL,
  `concepto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `detalle` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_ad_tmp`)
) ENGINE=InnoDB AUTO_INCREMENT=261 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS alumnos;

CREATE TABLE `alumnos` (
  `id_alumno` int(11) NOT NULL AUTO_INCREMENT,
  `cedula_alumno` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `nombres_alumno` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `apellidos_alumno` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_nacimiento_alumno` datetime NOT NULL,
  `fecha_ingreso_alumno` datetime NOT NULL,
  `horario_alumno` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `sexo_alumno` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `sucursal_alumno` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `paralelo_alumno` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `tipo_id` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `estado_alumno` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `id_cliente` int(11) NOT NULL,
  PRIMARY KEY (`id_alumno`)
) ENGINE=InnoDB AUTO_INCREMENT=290 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS autorizaciones_sri;

CREATE TABLE `autorizaciones_sri` (
  `id_autorizacion` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_documento` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `id_serie` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `autorizacion_sri` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `emision_autorizacion` datetime NOT NULL,
  `vence_autorizacion` datetime NOT NULL,
  `del_autorizacion` int(10) NOT NULL,
  `al_autorizacion` int(10) NOT NULL,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `imprenta` varchar(225) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_autorizacion`),
  UNIQUE KEY `id_autorizacion_sri` (`id_autorizacion`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS bancos_ecuador;

CREATE TABLE `bancos_ecuador` (
  `id_bancos` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_banco` varchar(4) COLLATE utf8_spanish2_ci NOT NULL,
  `nombre_banco` varchar(150) COLLATE utf8_spanish2_ci NOT NULL,
  `spi` varchar(2) COLLATE utf8_spanish2_ci NOT NULL,
  `sci` varchar(2) COLLATE utf8_spanish2_ci NOT NULL,
  PRIMARY KEY (`id_bancos`)
) ENGINE=InnoDB AUTO_INCREMENT=167 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS campus_alumnos;

CREATE TABLE `campus_alumnos` (
  `id_campus` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_campus` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_campus`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS cargo_iess;

CREATE TABLE `cargo_iess` (
  `id_rama` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_rama` varchar(3) COLLATE utf8_spanish2_ci NOT NULL,
  `cargo_rama` varchar(400) COLLATE utf8_spanish2_ci NOT NULL,
  `codigo_iess` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  PRIMARY KEY (`id_rama`)
) ENGINE=InnoDB AUTO_INCREMENT=1837 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS ciudad;

CREATE TABLE `ciudad` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `codigo` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `cod_prov` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `nombre` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=222 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS clientes;

CREATE TABLE `clientes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `nombre` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `tipo_id` varchar(2) COLLATE utf8_spanish_ci NOT NULL COMMENT 'tipo de identificacion',
  `ruc` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `telefono` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `email` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `direccion` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `parte_rel` varchar(2) COLLATE utf8_spanish_ci NOT NULL COMMENT 'parte relacionada',
  `fecha_agregado` datetime NOT NULL,
  `plazo` int(11) NOT NULL,
  `unidad_tiempo` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `id_usuario` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=554 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS comprobantes_autorizados;

CREATE TABLE `comprobantes_autorizados` (
  `id_comprobante` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_comprobante` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `comprobante` varchar(250) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_comprobante`),
  UNIQUE KEY `id_comprobante` (`id_comprobante`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS config_electronicos;

CREATE TABLE `config_electronicos` (
  `id_config` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `id_usuario` int(100) NOT NULL,
  `archivo_firma` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `pass_firma` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `correo_asunto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `correo_host` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `correo_pass` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `correo_port` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `correo_remitente` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `ssl_hab` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `tipo_ambiente` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `tipo_emision` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `resol_cont` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_fin_firma` datetime NOT NULL,
  PRIMARY KEY (`id_config`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS cuentas_bancarias;

CREATE TABLE `cuentas_bancarias` (
  `id_cuenta` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish2_ci NOT NULL,
  `id_banco` int(11) NOT NULL,
  `id_tipo_cuenta` int(11) NOT NULL,
  `numero_cuenta` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `codigo_contable` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  PRIMARY KEY (`id_cuenta`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS cuerpo_factura;

CREATE TABLE `cuerpo_factura` (
  `id_cuerpo_factura` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `serie_factura` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_factura` int(9) NOT NULL,
  `id_producto` int(11) NOT NULL,
  `cantidad_factura` float(20,4) NOT NULL,
  `valor_unitario_factura` float(20,4) NOT NULL,
  `subtotal_factura` float(20,2) NOT NULL,
  `tipo_produccion` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_iva` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_ice` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_bp` tinyint(5) NOT NULL,
  `descuento` float(20,2) NOT NULL,
  PRIMARY KEY (`id_cuerpo_factura`),
  UNIQUE KEY `id_cuerpo_factura` (`id_cuerpo_factura`)
) ENGINE=InnoDB AUTO_INCREMENT=1535 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS cuerpo_nc;

CREATE TABLE `cuerpo_nc` (
  `id_cuerpo_nc` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `serie_nc` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_nc` int(9) NOT NULL,
  `id_producto` int(11) NOT NULL,
  `cantidad_nc` float(20,4) NOT NULL,
  `valor_unitario_nc` float(20,4) NOT NULL,
  `subtotal_nc` float(20,2) NOT NULL,
  `tipo_produccion` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_iva` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_ice` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `tarifa_bp` tinyint(5) NOT NULL,
  `descuento` float(20,4) NOT NULL,
  PRIMARY KEY (`id_cuerpo_nc`),
  UNIQUE KEY `id_cuerpo_factura` (`id_cuerpo_nc`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS cuerpo_retencion;

CREATE TABLE `cuerpo_retencion` (
  `id_cr` int(11) NOT NULL AUTO_INCREMENT,
  `serie_retencion` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_retencion` varchar(9) COLLATE utf8_spanish_ci NOT NULL,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `id_retencion` int(11) NOT NULL,
  `ejercicio_fiscal` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `base_imponible` float(20,2) NOT NULL,
  `codigo_impuesto` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `impuesto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `porcentaje_retencion` int(11) NOT NULL,
  `valor_retenido` float(20,2) NOT NULL,
  PRIMARY KEY (`id_cr`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS descuentos_programados;

CREATE TABLE `descuentos_programados` (
  `id_descuento` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish2_ci NOT NULL,
  `mes_descuento` varchar(2) COLLATE utf8_spanish2_ci NOT NULL,
  `anio_descuento` varchar(4) COLLATE utf8_spanish2_ci NOT NULL,
  `id_referencia` int(11) NOT NULL,
  `id_producto` int(11) NOT NULL,
  `valor_descuento` float(10,2) NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  PRIMARY KEY (`id_descuento`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS detalle_adicional_factura;

CREATE TABLE `detalle_adicional_factura` (
  `id_detalle` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `serie_factura` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_factura` int(9) NOT NULL,
  `adicional_concepto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `adicional_descripcion` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_detalle`)
) ENGINE=InnoDB AUTO_INCREMENT=712 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS detalle_adicional_nc;

CREATE TABLE `detalle_adicional_nc` (
  `id_detalle` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `serie_nc` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_nc` int(9) NOT NULL,
  `adicional_concepto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `adicional_descripcion` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_detalle`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS detalle_adicional_retencion;

CREATE TABLE `detalle_adicional_retencion` (
  `id_detalle` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `serie_retencion` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_retencion` int(9) NOT NULL,
  `adicional_concepto` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `adicional_descripcion` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_detalle`)
) ENGINE=InnoDB AUTO_INCREMENT=238 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS detalle_facturas_en_bloque;

CREATE TABLE `detalle_facturas_en_bloque` (
  `id_detalle_fb` int(11) NOT NULL AUTO_INCREMENT,
  `id_facturas_en_bloque` int(11) NOT NULL,
  `codigo_cliente` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `periodo_emision` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `codigo_producto` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `cantidad_producto` float(9,2) NOT NULL,
  `precio_producto` float(9,2) NOT NULL,
  PRIMARY KEY (`id_detalle_fb`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS detalle_ingresos_egresos;

CREATE TABLE `detalle_ingresos_egresos` (
  `id_detalle_ing_egr` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish2_ci NOT NULL,
  `beneficiario_cliente` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  `valor_ing_egr` float(20,2) NOT NULL,
  `detalle_ing_egr` varchar(200) COLLATE utf8_spanish2_ci NOT NULL,
  `numero_ing_egr` int(11) NOT NULL,
  `tipo_ing_egr` varchar(20) COLLATE utf8_spanish2_ci NOT NULL,
  `tipo_documento` varchar(20) COLLATE utf8_spanish2_ci NOT NULL,
  PRIMARY KEY (`id_detalle_ing_egr`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS detalle_por_facturar;

CREATE TABLE `detalle_por_facturar` (
  `id_detalle_pf` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `id_referencia` int(11) NOT NULL COMMENT 'Codigo de referencia ejemplo codigo del estudiante',
  `id_producto` int(11) NOT NULL,
  `cant_producto` float(9,2) NOT NULL,
  `precio_producto` float(9,2) NOT NULL,
  `cuando_facturar` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `id_usuario` int(11) NOT NULL,
  PRIMARY KEY (`id_detalle_pf`)
) ENGINE=InnoDB AUTO_INCREMENT=1261 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS documentos_subidos;

CREATE TABLE `documentos_subidos` (
  `id_documento` int(11) NOT NULL AUTO_INCREMENT,
  `id_usuario` int(10) NOT NULL,
  `id_empresa` int(10) NOT NULL,
  `cod_documento` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `archivo` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `detalle` varchar(225) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `fecha_procesado` datetime NOT NULL,
  `estado` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_documento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS empleados;

CREATE TABLE `empleados` (
  `id_empleado` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish2_ci NOT NULL,
  `nombres_empleado` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  `apellidos_empleado` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  `cedula_empleado` varchar(10) COLLATE utf8_spanish2_ci NOT NULL,
  `sexo_empleado` varchar(1) COLLATE utf8_spanish2_ci NOT NULL,
  `dir_empleado` varchar(200) COLLATE utf8_spanish2_ci NOT NULL,
  `telf_empleado` varchar(30) COLLATE utf8_spanish2_ci NOT NULL,
  `nace_empleado` datetime NOT NULL,
  `rama_empleado` varchar(50) COLLATE utf8_spanish2_ci NOT NULL,
  `cargo_empleado` varchar(100) COLLATE utf8_spanish2_ci NOT NULL,
  `rel_iess` varchar(2) COLLATE utf8_spanish2_ci NOT NULL,
  `mail_empleado` varchar(64) COLLATE utf8_spanish2_ci NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `estado_empleado` varchar(20) COLLATE utf8_spanish2_ci NOT NULL,
  `usuario` varchar(10) COLLATE utf8_spanish2_ci NOT NULL,
  PRIMARY KEY (`id_empleado`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS empresa_asignada;

CREATE TABLE `empresa_asignada` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `id_empresa` int(11) NOT NULL,
  `id_usuario` int(10) NOT NULL,
  `usu_asignador` int(11) NOT NULL,
  `fecha_agredado` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS empresas;

CREATE TABLE `empresas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `nombre_comercial` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `ruc` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `direccion` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `telefono` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `tipo` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  `nom_rep_legal` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `ced_rep_legal` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `mail` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `logo` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `cod_prov` varchar(4) COLLATE utf8_spanish_ci NOT NULL COMMENT 'codigo provincia',
  `cod_ciudad` varchar(4) COLLATE utf8_spanish_ci NOT NULL COMMENT 'codigo ciudad',
  `estado` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `id_usuario` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS encabezado_factura;

CREATE TABLE `encabezado_factura` (
  `id_encabezado_factura` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_factura` datetime NOT NULL,
  `serie_factura` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_factura` int(11) NOT NULL,
  `id_cliente` int(11) NOT NULL,
  `observaciones_factura` varchar(225) COLLATE utf8_spanish_ci DEFAULT NULL,
  `guia_remision` varchar(9) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_registro` datetime NOT NULL,
  `estado_pago` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `tipo_factura` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `estado_sri` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `total_factura` float(20,2) NOT NULL,
  `id_usuario` int(50) NOT NULL,
  `ambiente` int(2) NOT NULL,
  `id_registro_contable` int(11) NOT NULL,
  `aut_sri` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `estado_mail` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_encabezado_factura`),
  UNIQUE KEY `id_encabezado_factura` (`id_encabezado_factura`),
  KEY `id_encabezado_factura_2` (`id_encabezado_factura`),
  KEY `id_encabezado_factura_3` (`id_encabezado_factura`)
) ENGINE=InnoDB AUTO_INCREMENT=250 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS encabezado_nc;

CREATE TABLE `encabezado_nc` (
  `id_encabezado_nc` int(11) NOT NULL AUTO_INCREMENT,
  `ruc_empresa` varchar(13) COLLATE utf8_spanish_ci NOT NULL,
  `fecha_nc` datetime NOT NULL,
  `serie_nc` varchar(7) COLLATE utf8_spanish_ci NOT NULL,
  `secuencial_nc` int(11) NOT NULL,
  `factura_modificada` varchar(17) COLLATE utf8_spanish_ci NOT NULL,
  `id_cliente` int(11) NOT NULL,
