DROP TABLE IF EXISTS tipos_documentos_subir;

CREATE TABLE `tipos_documentos_subir` (
  `id_documento` int(11) NOT NULL AUTO_INCREMENT,
  `detalle_documento` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `cod_documento` varchar(2) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`id_documento`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS usuario_asignado;

CREATE TABLE `usuario_asignado` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_usuario` int(11) NOT NULL,
  `id_adm` int(11) NOT NULL,
  `fecha_agredado` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS usuarios;

CREATE TABLE `usuarios` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) CHARACTER SET utf8 COLLATE utf8_spanish2_ci NOT NULL COMMENT 'nombre completo',
  `cedula` varchar(15) CHARACTER SET utf8 COLLATE utf8_spanish2_ci NOT NULL,
  `password` varchar(64) CHARACTER SET utf8 COLLATE utf8_spanish2_ci NOT NULL,
  `nivel` tinyint(3) unsigned NOT NULL,
  `mail` varchar(100) NOT NULL,
  `tipo` varchar(50) NOT NULL,
  `estado` varchar(10) NOT NULL,
  `fecha_agregado` datetime NOT NULL,
  `telefono` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;




