INSERT INTO info_legal VALUES("13","Los pagos con convenio de Debito o Recaudacion:  se registrara el porcentaje de retencion de acuerdo a la naturaleza de la transaccion.","RETENCIONES");
INSERT INTO info_legal VALUES("14","* Para las transacciones efectuadas en el exterior se debera considerar:  si existe convenio de doble tributacion, sin convenio de doble tributacion o a paraisos fiscales o regimenes fiscales preferentes, por esta razon el porcentaje esta abierto del 0 al 22% de acuerdo a la naturaleza de la transaccion.","RETENCIONES");
