INSERT INTO info_legal VALUES("20","* Para pagos a no residentes la tarifa general de retencion prevista en la Ley es del 22%, tratandose de pagos a personas residentes o establecidas en paraisos fiscales o jurisdicciones de menor imposicion la tarifa es del 35%. En los casos en que por disposicion legal o por aplicacion de un convenio para evitar doble imposicion se hubiese aplicado una tarifa diferente se debera registrar dicha tarifa en el anexo. ","RETENCIONES");
